import React from 'react';
import frontendImg from "../../assets/images/front-end.png";

const Services = () => {
  return (
    <section id="services" style={styles.section}>
      <div className="container">
        {/* Education Section */}
        <div style={styles.sectionHeader}>
          <h2 style={styles.sectionTitle}>Education</h2>
        </div>

        <div style={styles.timeline}>
          <div style={styles.timelineLine}></div>
          <div style={styles.timelineContent}>
            <TimelineCard
              title="CDAC"
              description="PG-DAC, IACSD, Pune"
              date="March 2024 – August 2024"
              imageSrc={frontendImg}
            />
            <TimelineCard
              title="Internship"
              description="Machine Learning Intern, Aiverient, Pune"
              date="June 2022 – February 2023"
              imageSrc={frontendImg}
            />
            <TimelineCard
              title="B.Tech"
              description="Mechanical Engineering, DKTE Textile and Engineering Institute, Ichalkaranji"
              date="2016 – 2020"
              additionalInfo="7.78 CGPA"
              imageSrc={frontendImg}
            />
            <TimelineCard
              title="HSC"
              description="A.K. Junior College, Atpadi"
              date="2014 – 2016"
              additionalInfo="67.54%"
              imageSrc={frontendImg}
            />
            <TimelineCard
              title="SSC"
              description="Shree Bhavnai Vidyalaya, Atpadi"
              date="2014"
              additionalInfo="90.60%"
              imageSrc={frontendImg}
            />
          </div>
        </div>

        {/* Projects Section */}
        <div style={styles.sectionHeader}>
          <h2 style={styles.sectionTitle}>Projects</h2>
        </div>

        <div style={styles.projects}>
          <ProjectCard
            title="AgroMaart - Online Agriculture Marketplace"
            description="An online platform connecting farmers, buyers, and delivery personnel."
            technologies="React, HTML, CSS, Spring Boot, Hibernate, MySQL"
            imageSrc={frontendImg}
          />
          <ProjectCard
            title="Music Recommendation System"
            description="A system leveraging user preferences to recommend music."
            technologies="Python, Flask, TensorFlow, Spotify API"
            imageSrc={frontendImg}
          />
          <ProjectCard
            title="Drug Review Using NLP"
            description="Analyzes drug reviews using natural language processing."
            technologies="Python, Flask, NLP, TensorFlow"
            imageSrc={frontendImg}
          />
        </div>
      </div>
    </section>
  );
};

// Timeline Card Component
const TimelineCard = ({ title, description, date, additionalInfo, imageSrc }) => (
  <div style={styles.timelineCard}>
    <div style={styles.cardImageContainer}>
      <img src={imageSrc} alt={title} style={styles.cardImage} />
    </div>
    <div style={styles.cardContent}>
      <h3 style={styles.cardTitle}>{title}</h3>
      <p style={styles.cardDescription}>{description}</p>
      {date && <p style={styles.cardDate}>{date}</p>}
      {additionalInfo && <p style={styles.cardAdditionalInfo}>{additionalInfo}</p>}
    </div>
  </div>
);

// Project Card Component
const ProjectCard = ({ title, description, technologies, imageSrc }) => (
  <div style={styles.projectCard}>
    <div style={styles.projectContent}>
      <h3 style={styles.cardTitle}>{title}</h3>
      <p style={styles.cardDescription}>{description}</p>
      <p style={styles.cardTechnologies}><b>Technologies:</b> {technologies}</p>
    </div>
    <div style={styles.cardImageContainer}>
      <img src={imageSrc} alt={title} style={styles.cardImage} />
    </div>
  </div>
);

// Styles
const styles = {
  section: {
    padding: '3rem 1rem',
    backgroundColor: '#f5f5f5',
  },
  sectionHeader: {
    textAlign: 'center',
    marginBottom: '2rem',
  },
  sectionTitle: {
    color: '#1a202c',
    fontWeight: 'bold',
    fontSize: '2.5rem',
    margin: '0',
    textShadow: '2px 2px 4px rgba(0, 0, 0, 0.3)',
  },
  timeline: {
    position: 'relative',
    padding: '2rem 0',
  },
  timelineLine: {
    position: 'absolute',
    width: '4px',
    height: '100%',
    backgroundColor: '#2b6cb0',
    left: '50%',
    transform: 'translateX(-50%)',
  },
  timelineContent: {
    marginTop: '2rem',
    marginLeft: 'auto',
    marginRight: 'auto',
    width: '100%',
    maxWidth: '800px',
  },
  timelineCard: {
    display: 'flex',
    alignItems: 'center',
    backgroundColor: '#ffffff',
    borderRadius: '8px',
    boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
    padding: '1rem',
    marginBottom: '1rem',
    position: 'relative',
    width: '100%',
  },
  cardImageContainer: {
    marginRight: '1rem',
  },
  cardImage: {
    width: '60px',
    height: '60px',
    borderRadius: '50%',
    border: '2px solid #2b6cb0',
  },
  cardContent: {
    flex: 1,
  },
  cardTitle: {
    color: '#2b6cb0',
    fontSize: '1.5rem',
    marginBottom: '0.5rem',
  },
  cardDescription: {
    fontSize: '1rem',
    color: '#4a5568',
  },
  cardDate: {
    fontSize: '0.875rem',
    color: '#718096',
    marginTop: '0.5rem',
  },
  cardAdditionalInfo: {
    fontSize: '0.875rem',
    color: '#718096',
    marginTop: '0.5rem',
  },
  cardTechnologies: {
    fontSize: '0.875rem',
    color: '#718096',
    marginTop: '0.5rem',
  },
  projectCard: {
    display: 'flex',
    alignItems: 'center',
    backgroundColor: '#ffffff',
    borderRadius: '8px',
    boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
    padding: '1rem',
    marginBottom: '1rem',
    width: '100%',
  },
  projectContent: {
    flex: 1,
  },
};

export default Services;
